import './Modal.css';
// Components
/* import { General } from './General'; */


// Images pad
const ico = require.context('../../../assets/ico/',true);
const stack = require.context('../../../assets/stacks/', true);

const Modal = () => {
    return(
        <>
            <overlay>
                <div className="modalWindow">
                    <div className='modalWindow__header'>
                        <img className='modalWindow__imgStack' src={stack('./bash.png')} alt="ico stack"/>
                        <h3>Bash</h3>

                        <img className='modalWindow__icoClosed' src={ico('./closed.png')} alt="ico closed"/>

                    </div>

                    <ul className='modalWindow__navBar'>
                        <li className='modalWindow__button'>Generl</li>
                        <li className='modalWindow__button'>Proyectos & c√≥digo</li>
                    </ul>

                    {/* <General /> */}

                </div>
            </overlay>
        </>
    );
}

export {Modal};
